function axisTest() {
    'use strict';

    var chart;

    describe("cl.Axis", function() {

        before(function() {
            chart = new cl.Chart({ element: document.getElementById("test") });
        });

        it('should exist x axis', function(){
            should.exist(chart.xAxis);
        });

        it('should exist y axis', function(){
            should.exist(chart.yAxis);
        });

        it('should exist AxisManager', function(){
            should.exist(chart.axis);
        });

        it('should add new axis', function(){
            var a = chart.axis.add({type: "y", name: "custom axis", offset: 10});
            should.exist(a);
        });

        it('should find axis by index', function(){
            var a = chart.axis.get(2);
            should.exist(a);
        });

        it('should find axis by name', function(){
            var a = chart.axis.get("custom axis");
            should.exist(a);
        });

        it('should deny X axis removing', function(){
            expect(function(){chart.axis.remove(0)}).to.throw("Can not delete base 'x' axis");
            expect(chart.axis.items.length).to.equal(3);
        });

        it('should deny Y axis removing', function(){
            expect(function(){chart.axis.remove(1)}).to.throw("Can not delete base 'y' axis");
            expect(chart.axis.items.length).to.equal(3);
        });

        it('should set axis min', function(){
            chart.xAxis.setMin(-10);
            expect(chart.xAxis.getMin()).to.equal(-10);
            chart.yAxis.setMin(-10);
            expect(chart.yAxis.getMin()).to.equal(-10);
        });

        it('should set axis max', function(){
            chart.xAxis.setMax(20);
            expect(chart.xAxis.getMax()).to.equal(20);
            chart.yAxis.setMax(20);
            expect(chart.yAxis.getMax()).to.equal(20);
        });

        it('should set axis name', function(){
            chart.xAxis.setName("hello");
            expect(chart.xAxis.getName()).to.equal("hello");
        });

        it('should set axis offset', function(){
            chart.xAxis.setOffset(10);
            expect(chart.xAxis.getOffset()).to.equal(10);
        });

        it('should set axis color', function(){
            chart.xAxis.setColor("#FFAAEE");
            expect(chart.xAxis.getColor()).to.equal("#FFAAEE");
        });

        it('should set line width', function(){
            chart.xAxis.setLineWidth(2);
            expect(chart.xAxis.getLineWidth()).to.equal(2);
        });

        it('should set title size', function(){
            chart.xAxis.setTitleSize(18);
            expect(chart.xAxis.getTitleSize()).to.equal(18);
        });

        it('should set title font', function(){
            chart.xAxis.setTitleFont("Times New Roman");
            expect(chart.xAxis.getTitleFont()).to.equal("Times New Roman");
        });

        it('should set title align', function(){
            chart.xAxis.setTitleAlign("right");
            expect(chart.xAxis.getTitleAlign()).to.equal("right");
        });

        it('should set title color', function(){
            chart.xAxis.setTitleColor("#FF2233");
            expect(chart.xAxis.getTitleColor()).to.equal("#FF2233");
        });

        it('should set title style', function(){
            chart.xAxis.setTitleStyle("bold");
            expect(chart.xAxis.getTitleStyle()).to.equal("bold");
        });

        it('should set axis margin', function(){
            chart.xAxis.setMargins(100, 80);
            expect(chart.xAxis.getMargins().start).to.equal(100);
            expect(chart.xAxis.getMargins().end).to.equal(80);

            chart.yAxis.setMargins(50, 30);
            expect(chart.yAxis.getMargins().start).to.equal(50);
            expect(chart.yAxis.getMargins().end).to.equal(30);
        });

        it('should convert from screen to axis coordinate', function(){
            expect(chart.xAxis.toAxis(100)).to.equal(-10);
            expect(chart.xAxis.toAxis(chart.width - 80)).to.equal(20);

            expect(chart.yAxis.toAxis(50)).to.equal(-10);
            expect(chart.yAxis.toAxis(chart.height - 30)).to.equal(20);
        });

        it('should convert from axis coordinate to screen', function(){
            expect(chart.xAxis.toScreen(-10)).to.equal(100);
            expect(chart.xAxis.toScreen(20)).to.equal(chart.width - 80);

            expect(chart.yAxis.toScreen(-10)).to.equal(chart.height - 50);
            expect(chart.yAxis.toScreen(20)).to.equal(30);
        });

        it('should set tick interval', function() {
            chart.yAxis.setTickInterval(5);
            expect(chart.yAxis.getTickInterval()).to.equal(5);
        });

        it('should set small tick interval', function() {
            chart.yAxis.setTickIntervalSmall(1);
            expect(chart.yAxis.getTickIntervalSmall()).to.equal(1);
        });

        it('should pass call to apply', function() {
            chart.yAxis.apply();
            chart.xAxis.apply();
        });

        it('should pass chain calls', function(){
            chart.yAxis
                .setColor("#44FFFF")
                .setTitleColor("#2255FF")
                .setTitleAlign("bottom")
                .setTitleSize(32)
                .setName("Test axis")
                .setTitleFont("Times New Roman")
                .setTitleStyle("italic")
                .apply();
        });

        it('should be equal to reference image', function(done) {
            setTimeout(function() {
                var ref = new Image();
                ref.src = "data:image/png;base64,";

                expect(imagediff.equal(chart.screen.el, ref, 300)).equal(true);

                chart.destroy();
                done();
            }, 100);
        });

    });

}
